import React from "react";
import axios from "axios";

function WeatherDetail() {
  let url =
    "api.openweathermap.org/data/2.5/forecast?q=San+Francisco&appid=0b8748d716f8e438393856aa8448e0ba";
  console.log(url);
}

export default WeatherDetail;
